import React from 'react';
import {
  AppBar,
  // Container,
  Toolbar, 
  // Menu,
  // MenuItem, 
  Typography,
  List,
  ListItem,
  Link
} from '@mui/material';

// const pages = ['About', 'Work', 'Contact'];
const pages = [
  {
    name: 'About',
    path: '/about'
  },
  {
    name: 'Work',
    path: '/work'
  },
  {
    name: 'Contact',
    path: '/contact'
  }
]

const NavBar = () => {
  return (
    <AppBar 
      position="relative"
      elevation={5}
      sx={{
        height: '7rem',
        // background: 'rgb(121,171,189)',
        background: 'linear-gradient(90deg, rgba(42,33,110,1) 0%, rgba(121,162,189,1) 100%)',
        margin: '.5rem',
        maxWidth: 1000,
        mx: 'auto',
        borderRadius: 1,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'left'
      }}
    >
      <Toolbar>
        <List
          sx={{
            display: 'flex',
            flexDirection: 'row',
            
          }}
        >
          {pages.map((page) => (
              <ListItem key={page}>
                <Typography
                  variant="h6" 
                  textAlign="center"

                >
                 <Link href={page.path}>{page.name}</Link>
                </Typography>
              </ListItem>
            ))}
        </List>
      </Toolbar>
    </AppBar>
  );
};
export default NavBar;
